import React from "react";
import logo from "./Image/cover.jpg";

class CityImage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { props } = this;

    const destinyPhoto = {
      Praga: `${logo}`,
      Boston: "http://path-to-boston-image.jpg",
      Sydney:
        "https://astelus.com/wp-content/viajes/Guia-turistica-de-Sidney.jpg",
      "Buenos Aires":
        "https://upload.wikimedia.org/wikipedia/commons/b/be/J30_464_Hochh%C3%A4user_um_die_Azucena_Villaflor.jpg",
      Tokyo:
        "https://upload.wikimedia.org/wikipedia/commons/4/42/Tokyocity.png",
    };
    return (
      <>
        <h2>{props.city}</h2>

        <img src={destinyPhoto[props.city]} alt={props.city} />
      </>
    );
  }
}
export default CityImage;
